import * as UploadApi from '../api/UploadRequest'
export const uploadImage = (data => async (dispatch) => {
    try {
        await UploadApi.uploadImage(data)

    } catch (error) {
        console.log(error)
    }
})

export const uploadPost = (data => async (dispatch) => {
    try {
        await UploadApi.uploadPost(data)
    } catch (error) {
        console.log(error)
    }
})
